import React from 'react';

const CustomDock = () => {

    return (
        <div className='mx-auto min-h-screen flex flex-col items-center justify-center py-20 max-md:py-16 px-8 bg-gray-300'>
            <h2 className='md:text-4xl text-3xl font-semibold text-gray-600 sm:pb-8 pb-5'>Gallery</h2>
            <div className='flex gap-4 bg-gray-900 w-full py-5 rounded-2xl'>
                <img className='w-full rounded-2xl hover:scale-110 transition-all duration-300 h-full max-w-[80px]' src="/assets/images/png/finder.png" alt="img" />
            </div>
            <div className='fixed inset-0 bg-black/90 justify-center items-center z-50 px-5 hidden'>
                <div className="max-w-[500px] overflow-hidden rounded-2xl max-h-[600px]">
                </div>
            </div>
        </div>
    )
}

export default CustomDock
